export class User{
    id: number;
    username: string;
    password: string;
    email: string;
    name: string;
    surname: string;
    birthDate: string;
    birthPlace: string;
    cf: string;
    created_at: Date;
    update_at: Date;
    enable: Boolean;

    constructor(){
        this.id = 0
        this.username = '';
        this.password = '';
        this.email = '';
        this.name = '';
        this.surname = '';
        this.birthDate = '';
        this.birthPlace = '';
        this.cf = '';
        this.created_at = new Date;
        this.update_at = new Date;
        this.enable = new Boolean("");
    }
}
